            imgReview.onload = function () {
                URL.revokeObjectURL(imgReview.src);
            }
        });
        $(""#fUpload"").submit(function (e) {
            if ($(""#updateImgChannel"").val() != '') return;
            $(""#errorimg"").text('(Vui lòng chọn ảnh)');
            e.preventDefault();
        });
