                them: 'clasic',
                placeholder: 'Tìm kiếm......',
                data: respone
            });
        })
        //-------End----------------");
            WriteLiteral(@"----
        //----------Pagination----------
        $('.site-layout').on('scroll', function () {
            let div = $(this).get(0);
            if (div.scrollTop + div.clientHeight >= div.scrollHeight) {
                loadData();
                setTimeout(function () {
                    loadDurationTime();
                }, 1000);
                currentPage += 1;
            }
        });
        function loadData() {
            var inputSearch = $(""#select2-search_name_video-container"").text();
            if (inputSearch == ""Tìm kiếm"")
