            $.get(""/Video/MyPage_Partial/?id="" + $(""#idChannel"").val() + ""&page="" + currentPage + ""&nameSearch="" + inputSearch,
                function (respone) {
                $('.content_video').append(respone);
                loadSecondVideo();
                LoadEventMoseLeave();
            });
        }
        //----------End-----------------
    });
